void OyFl_Box::label(const char * l) {
  label_orig = new char (strlen(l)+1);
  sprintf(label_orig, l);
  Fl_Box::label( l );
}

void OyFl_Box::copy_label(const char* l) {
  label_orig = new char (strlen(l)+1);
  sprintf(label_orig, l);
  Fl_Box::copy_label(l);
}

